import React from "react";
import Card from "./Card"
import contacts from "./contacts"

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
     <Card 
       name = {contacts[0].name}
       img = {contacts[0].img}
       tel = "+123 456 789"
       email = "b@beyonce.com"
     /> 

    </div>
  );
}

export default App;
